  <h1>And display random values: ({{place}}-side rendering)</h1>
  <div>
    <p id="valueA">a={{valueA}}</p>
    <p id="valueB">b={{valueB}}</p>
    <p id="valueC">c={{valueC}}</p>
  </div>
  <script>
  var index, text, place, valueA, valueB, valueC;
  place = document.querySelectorAll('h1')[1];
  if ((index = place.textContent.indexOf('place')) !== -1) {
    // Initial load.
    text = place.textContent;
    place.textContent = text.slice(0, index - 2) + 'Service Worker' + text.slice(index + 7);
    valueA = document.querySelector('#valueA');
    valueB = document.querySelector('#valueB');
    valueC = document.querySelector('#valueC');
    valueA.textContent = 'a=' + (Math.floor(Math.random() * 6) + 1);
    valueB.textContent = 'b=' + (Math.floor(Math.random() * 6) + 1);
    valueC.textContent = 'c=' + (Math.floor(Math.random() * 6) + 1);
  }
  </script>
